import React from 'react'
import { NavLink } from 'react-router-dom'
import { connect } from 'react-redux'
import { signOutAction } from '../../store/actions/AuthActions'
import DropDown from './dropDown'
import user from '../../static/icons/user.png'

const SignedInLinks = (props) => {
  const { profile } = props
  const userImage = profile && profile.pictureUrl ? profile.pictureUrl : user
  const id = props.auth.uid
  const { notifications } = props
  return(
    <div>
      <ul className="right nav-links">
        <li className="drop_down-btn">
          <NavLink to={'/profile/'+ id}
            className="btn btn-floating grey lighten-4 z-depth-0 black-text">
              <img
                src={userImage}
                className="circle_img"
                alt="dp"
                height="40px"
                width="40px" />
          </NavLink>
        </li>
        <li>
          <NavLink
            to='/'
            className="black-text"
            onClick={props.signOut}>
              Log Out
          </NavLink>
        </li>
        <li> Notifications </li>
      </ul>
    </div>
  )
}

const mapStateToProps = (state) => {
  // console.log(state)
  return {
    profile: state.firebase.profile,
    auth: state.firebase.auth,
    notifications: state.firestore.ordered.notifications
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    signOut: () => dispatch(signOutAction())
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(SignedInLinks)
